const s=["scene","staff","type"];export function match(t,e){for(let n in t)if(n==="skin"){let f=new Set;for(let o of e.staff)if(o!=="F")for(let r of e.skin[o])f.add(r);let i=Array.from(f);if(!l(t.skin,i))return console.log("skin not match"),!1}else if(n==="platform"){if(t.platform.indexOf(e.platform)===-1)return console.log("platform not match"),!1}else if(s.indexOf(n)!==-1){if(!l(t[n],e[n]))return console.log("insert not match"),!1}else continue;return!0}function l(t,e){return t.length+e.length!==Array.from(new Set([...t,...e])).length}
